import React, { useState, useEffect } from 'react';
import { VuiFlexContainer, VuiFlexItem, VuiTitle, VuiText, VuiSpacer } from '../../ui';
import { AppHeader } from '../chrome/AppHeader';
import './harvardManagementDocuments.scss';
import { useSearchContext } from '../../contexts/SearchContext';

// Define document type
interface Document {
  id: string;
  title: string;
  date: string;
  type: string;
  description?: string;
  url?: string;
}

// Sample documents
const DOCUMENTS: Document[] = [
  {
    id: "hm-20250412",
    title: "Harvard Endowment Performance Review Q1 2025",
    date: "April 12, 2025",
    type: "Quarterly Report"
  },
  {
    id: "hm-20250328",
    title: "ESG Integration in Fixed Income Strategies",
    date: "March 28, 2025",
    type: "Market Outlook"
  },
  {
    id: "hm-20250215",
    title: "Alternative Investment Allocation Strategy",
    date: "February 15, 2025",
    type: "Investment Strategy"
  },
  {
    id: "hm-20250129",
    title: "Global Macro Economic Outlook",
    date: "January 29, 2025",
    type: "Market Outlook"
  },
  {
    id: "hm-20250110",
    title: "Emerging Markets Debt Analysis",
    date: "January 10, 2025",
    type: "Market Outlook"
  },
  {
    id: "hm-20241215",
    title: "Climate Risk Assessment Framework",
    date: "December 15, 2024",
    type: "Risk Analysis"
  },
  {
    id: "hm-20241128",
    title: "Quarterly Asset Allocation Review",
    date: "November 28, 2024",
    type: "Quarterly Report"
  },
  {
    id: "hm-20241105",
    title: "Innovation in Healthcare Investments",
    date: "November 5, 2024",
    type: "Sector Analysis"
  },
  // Additional documents
  {
    id: "hm-20241022",
    title: "Private Equity Performance Analysis 2024",
    date: "October 22, 2024",
    type: "13-F"
  },
  {
    id: "hm-20240915",
    title: "Sustainable Investing Annual Report",
    date: "September 15, 2024",
    type: "10-K"
  },
  {
    id: "hm-20240830",
    title: "Harvard Management Company Board Meeting Minutes",
    date: "August 30, 2024",
    type: "Corporate Document"
  },
  {
    id: "hm-20240725",
    title: "Inflation Impact on University Endowments",
    date: "July 25, 2024",
    type: "Market Outlook"
  },
  {
    id: "hm-20240620",
    title: "Alternative Asset Allocation Strategy",
    date: "June 20, 2024",
    type: "Investment Strategy"
  },
  {
    id: "hm-20240515",
    title: "Venture Capital Portfolio Review",
    date: "May 15, 2024",
    type: "13-F"
  },
  {
    id: "hm-20240410",
    title: "Emerging Markets Investment Thesis",
    date: "April 10, 2024",
    type: "Market Outlook"
  },
  {
    id: "hm-20240320",
    title: "Fixed Income Strategy in Rising Rate Environment",
    date: "March 20, 2024",
    type: "Market Outlook"
  },
  {
    id: "hm-20240214",
    title: "Hedge Fund Performance Evaluation",
    date: "February 14, 2024",
    type: "Form ADV"
  },
  {
    id: "hm-20240120",
    title: "Real Estate Portfolio Analysis",
    date: "January 20, 2024",
    type: "13-F"
  },
  {
    id: "hm-20231205",
    title: "Natural Resources Investment Outlook",
    date: "December 5, 2023",
    type: "Market Outlook"
  },
  {
    id: "hm-20231110",
    title: "Public Equity Market Assessment",
    date: "November 10, 2023",
    type: "Quarterly Report"
  },
  {
    id: "hm-20231025",
    title: "Risk Management Framework Update",
    date: "October 25, 2023",
    type: "Form ADV"
  }
];

export const HarvardManagementDocuments = () => {
  const { onSearch } = useSearchContext();
  const [documents, setDocuments] = useState<Document[]>(DOCUMENTS);
  const [sortOrder, setSortOrder] = useState<'asc' | 'desc'>('desc');
  const [searchTerm, setSearchTerm] = useState('');

  // Handle document search
  useEffect(() => {
    if (searchTerm === '') {
      setDocuments(DOCUMENTS);
    } else {
      const filtered = DOCUMENTS.filter(doc => 
        doc.title.toLowerCase().includes(searchTerm.toLowerCase()) ||
        doc.type.toLowerCase().includes(searchTerm.toLowerCase())
      );
      setDocuments(filtered);
    }
  }, [searchTerm]);

  // Handle sort order change
  const handleSortChange = () => {
    const newOrder = sortOrder === 'desc' ? 'asc' : 'desc';
    setSortOrder(newOrder);

    const sorted = [...documents].sort((a, b) => {
      const dateA = new Date(a.date);
      const dateB = new Date(b.date);
      return newOrder === 'desc' ? 
        dateB.getTime() - dateA.getTime() : 
        dateA.getTime() - dateB.getTime();
    });

    setDocuments(sorted);
  };

  // Handle document click
  const handleDocumentClick = (document: Document) => {
    if (document.title) {
      onSearch({ value: document.title });
    }
  };

  return (
    <div className="documentsPage">
      <AppHeader />

      <div className="documentsContainer">
        <VuiFlexContainer direction="column" spacing="l">
          <VuiFlexItem>
            <VuiFlexContainer justifyContent="spaceBetween" alignItems="center">
              <VuiFlexItem>
                <VuiTitle size="m">
                  <h2>Documents</h2>
                </VuiTitle>
              </VuiFlexItem>
              <VuiFlexItem grow={false}>
                <div className="documentControls">
                  <input 
                    type="text" 
                    placeholder="Search documents..."
                    value={searchTerm}
                    onChange={(e) => setSearchTerm(e.target.value)}
                    className="documentSearchInput"
                  />
                  <button 
                    className="modernButton sortButton" 
                    onClick={handleSortChange}
                  >
                    Sort by Date {sortOrder === 'desc' ? '(Newest First)' : '(Oldest First)'}
                  </button>
                </div>
              </VuiFlexItem>
            </VuiFlexContainer>
          </VuiFlexItem>

          <VuiSpacer size="m" />

          {documents.length > 0 ? (
            <VuiFlexContainer direction="column" spacing="s">
              {documents.map(doc => (
                <VuiFlexItem key={doc.id}>
                  <div className="documentItem" onClick={() => handleDocumentClick(doc)}>
                    <div className="documentInfo">
                      <div className="documentTitle">{doc.title}</div>
                      <div className="documentType">{doc.type}</div>
                    </div>
                    <div className="documentDate">{doc.date}</div>
                  </div>
                </VuiFlexItem>
              ))}
            </VuiFlexContainer>
          ) : (
            <VuiFlexItem>
              <VuiText>
                <p className="noDocuments">No documents matching your search criteria.</p>
              </VuiText>
            </VuiFlexItem>
          )}
        </VuiFlexContainer>
      </div>
    </div>
  );
};
